  [],\n\t\"revision_timestamp\": \"2016-07-27T22:52:33.641892\",\n\t\"name\": \"rice-lake-national-wildlife-refuge-mille-lacs-refuge-sandstone-unit-narrative-report-j-30--3b172\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Rice Lake
  NWR and Mille Lacs NWR outlines Refuge accomplishments during the 1975 fiscal year.
  The report begins by summarizing the weather conditions, habitat conditions, water
  conditions, and food and cover conditions during the year. Wildlife- including migratory
  birds, upland game birds, big game animals, furbearers, predators, rodents, mammals,
  raptors, fish, and disease- is also covered. The Refuge development and maintenance
  section discusses physical developments, plantings, collections and receipts, vegetation
  control, prescribed burns, and wildfires. The resources management section discusses
  grazing, haying, fur harvesting, and timber removal. A progress report on field
  investigations and applied research is included. The public relations section of
  the report describes recreational uses, hunting, fishing, violations, and safety.
  Items of interest are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
